import StageComp from "./stageComp";

const Stages = () => {
    return (
        <div className="w-[960px] h-fit justify-start items-center gap-4 inline-flex ml-[15px] mt-[15px] flex-wrap ">
            <StageComp/>
            <StageComp/>
            <StageComp/>
        </div>
    );
};

export default Stages;
